import React from "react";
import styles from "./HomePage.styles.js";
import {withStyles} from "@material-ui/core";

const HomePage = props => {
  return (
      <div>
        <h1>Hello World!</h1>
        <h5>I am Joshua Anderson</h5>
      </div>
  );
};

export default withStyles(styles)(HomePage);
